  OPTIONAL {
    ?successor dbo:abstract ?successorAbstract .
    FILTER(CONTAINS(LCASE(?successorAbstract), "royalty")) .
    FILTER(CONTAINS(LCASE(?successorAbstract), "louis i"))
  }
}
