PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT ?person ?name WHERE {
  # Get the death date of Pavel Vezhinov
  dbr:Pavel_Vezhinov dbo:deathDate ?deathDate .

  # Find persons who are sports managers, soccer managers, and soccer players
  ?person a dbo:Person ;
          rdfs:label ?name ;
          dbo:birthDate ?birthDate ;
          dbo:abstract ?abstract .

  # Filter for roles
  { ?person dbo:abstract ?abstract . FILTER(CONTAINS(LCASE(?abstract), "sports manager")) }
  UNION
  { ?person dbo:abstract ?abstract . FILTER(CONTAINS(LCASE(?abstract), "soccer manager")) }
  UNION
  { ?person dbo:abstract ?abstract . FILTER(CONTAINS(LCASE(?abstract), "soccer player")) }

  # Ensure the person was born on or before the death date of Pavel Vezhinov
  FILTER(?birthDate <= ?deathDate)

  # Language filter for results
  FILTER (lang(?name) = 'en')
}
```

